webpackJsonp([0x6898f0f9845b],{1833:function(A,a){A.exports={data:{markdownRemark:{html:'<p>If you want to go to South Korea and find a place to entertain â€“ a bustling, funny and big enough for a whole day playing, why donâ€™t you take a chance on Everland. It is a <span style="color:PaleVioletRed"><strong>Korea\'s largest theme park</strong> </span>, operated by SAMSUNG cooperation and located at the Everland Resort in Yongin City. Along with its main attractions, <strong>Everland</strong> includes a <strong>zoo</strong> and <strong>water park</strong> known as <strong>Caribbean Bay</strong>, but Iâ€™m not confidence wearing bikini so I just skip the Bay . Iâ€™ll show you in details about Everland theme park which has <strong>5 different zones</strong>: Global Fair, American Adventure, Magic Land, European Adventure, and Zootopia.\nThis is  <a href="http://www.everland.com/web/multi/english/everland/main.html" target="_blank">Everland website.</a></p>\n<figure style="width: 600px" class="align-center">\n  \n  <a class="gatsby-resp-image-link" href="/static/everland-1-2877eb15bd163ee8a777af26614599fd-1fc51.png" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 1200px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 116.4391353811149%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/jpeg;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="everland 1" title="" src="/static/everland-1-2877eb15bd163ee8a777af26614599fd-abe1c.png" srcset="/static/everland-1-2877eb15bd163ee8a777af26614599fd-10046.png 300w,\n/static/everland-1-2877eb15bd163ee8a777af26614599fd-3c4a3.png 600w,\n/static/everland-1-2877eb15bd163ee8a777af26614599fd-abe1c.png 1200w,\n/static/everland-1-2877eb15bd163ee8a777af26614599fd-1fc51.png 1758w" sizes="(max-width: 1200px) 100vw, 1200px">\n    </span>\n  </span>\n  \n  </a>\n    \n  <figcaption></figcaption>\n</figure>\n<h3 id="span-stylecolordeepskyblue-global-fair-span"><a href="#span-stylecolordeepskyblue-global-fair-span" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a><span style="color:deepskyblue"> Global Fair </span></h3>\n<p>Itâ€™s primarily a place for food, souvenirs, and pictures. The cheerful music is played along the street lined with many beautiful architectures from all over the world. Once you enter the park, youâ€™ll see this zone first. You can also find needed services such as stroller rental and lockers here. (I did take many nice photos here ðŸ“·)</p>\n<figure class="half">\n   \n  <a class="gatsby-resp-image-link" href="/static/everland-2-45c0e06faae17bce75d75f2f25e758d7-d2263.png" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 192px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 111.45833333333333%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/jpeg;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="everland 2" title="" src="/static/everland-2-45c0e06faae17bce75d75f2f25e758d7-d2263.png" srcset="/static/everland-2-45c0e06faae17bce75d75f2f25e758d7-d2263.png 192w" sizes="(max-width: 192px) 100vw, 192px">\n    </span>\n  </span>\n  \n  </a>\n    \n   \n  <a class="gatsby-resp-image-link" href="/static/everland-3-89ec15e951385d57e4b49ad646d02064-08e25.png" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 300px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 71.33333333333334%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/jpeg;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="everland 3" title="" src="/static/everland-3-89ec15e951385d57e4b49ad646d02064-08e25.png" srcset="/static/everland-3-89ec15e951385d57e4b49ad646d02064-08e25.png 300w" sizes="(max-width: 300px) 100vw, 300px">\n    </span>\n  </span>\n  \n  </a>\n    \n   <figcaption></figcaption>\n</figure>\n<p>The cable car was also good. Slow speed helps you enjoy the scene!</p>\n<figure style="width: 300px" class="align-center">\n  \n  <a class="gatsby-resp-image-link" href="/static/everland-4-bd1dbda176ea1ba67d4208be351648e5-5d1ec.png" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 600px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 66.5%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/jpeg;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="everland 4" title="" src="/static/everland-4-bd1dbda176ea1ba67d4208be351648e5-5d1ec.png" srcset="/static/everland-4-bd1dbda176ea1ba67d4208be351648e5-81040.png 300w,\n/static/everland-4-bd1dbda176ea1ba67d4208be351648e5-5d1ec.png 600w" sizes="(max-width: 600px) 100vw, 600px">\n    </span>\n  </span>\n  \n  </a>\n    \n  <figcaption></figcaption>\n</figure>\n<h3 id="span-stylecolorcrimson-american-adventure-span"><a href="#span-stylecolorcrimson-american-adventure-span" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a><span style="color:crimson"> American Adventure </span></h3>\n<p>This zone is based on the theme of 500 years of American history, from the time when Columbus discovered the American Continent to the 1960s when Elvis Presley ruled the music record. In this zone, you can experience many thrilling games. (thrilling things are not my style, so I just took a look in this zone guys ðŸ˜…)</p>\n<figure style="width: 650px" class="align-center">\n  \n  <a class="gatsby-resp-image-link" href="/static/everland-5-bc7dd06089a15c15022b9f7fa1fa012b-c51d3.png" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 843px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 85.6465005931198%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/png;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="everland 5" title="" src="/static/everland-5-bc7dd06089a15c15022b9f7fa1fa012b-c51d3.png" srcset="/static/everland-5-bc7dd06089a15c15022b9f7fa1fa012b-4a902.png 300w,\n/static/everland-5-bc7dd06089a15c15022b9f7fa1fa012b-c3dca.png 600w,\n/static/everland-5-bc7dd06089a15c15022b9f7fa1fa012b-c51d3.png 843w" sizes="(max-width: 843px) 100vw, 843px">\n    </span>\n  </span>\n  \n  </a>\n    \n  <figcaption></figcaption>\n</figure>\n<h3 id="span-stylecolorblueviolet-magic-land-span"><a href="#span-stylecolorblueviolet-magic-land-span" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a><span style="color:blueviolet"> Magic Land </span></h3>\n<p>Magic land is an area with buildings and rides, mostly for kids. There is a place called Aesop\'s Village - a cute little fairy tale land based on the fables of Aesop. Along with the rides, there are many restaurants and stands. I didn\'t spend much time here, but the Rotating House was good. ðŸ˜„</p>\n<figure style="width: 350px" class="align-center">\n  \n  <a class="gatsby-resp-image-link" href="/static/everland-6-8721a306774eecaf03e8eca86b73a324-d5e1a.png" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 494px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 121.4574898785425%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/jpeg;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="everland 6" title="" src="/static/everland-6-8721a306774eecaf03e8eca86b73a324-d5e1a.png" srcset="/static/everland-6-8721a306774eecaf03e8eca86b73a324-4302e.png 300w,\n/static/everland-6-8721a306774eecaf03e8eca86b73a324-d5e1a.png 494w" sizes="(max-width: 494px) 100vw, 494px">\n    </span>\n  </span>\n  \n  </a>\n    \n  <figcaption></figcaption>\n</figure>\n<h3 id="span-stylecolorolive-european-adventure-span"><a href="#span-stylecolorolive-european-adventure-span" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a><span style="color:olive"> European Adventure </span></h3>\n<p>Wonderful flowers in a seasonal garden such as tulips, roses are in bloom throughout the year. This theme zone also provides many attractions especially the T-express - Korea\'s first wooden coaster with a prefabricated track, the first ride of this type in Asia, and the first to employ three trains. It is world\'s fourth steepest wooden roller coaster, world\'s ninth fastest, fourth tallest, and sixth longest wooden coaster. Due to the hillside, T-express also takes advantage of the high terrain.</p>\n<div style="text-align: center">\n  <div style="display: inline-block; padding:5px">\n    \n  <a class="gatsby-resp-image-link" href="/static/everland-7-cb1b30606132614e0d79a9b73a314733-91afe.png" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 218px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 132.56880733944953%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/jpeg;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="everland 7" title="" src="/static/everland-7-cb1b30606132614e0d79a9b73a314733-91afe.png" srcset="/static/everland-7-cb1b30606132614e0d79a9b73a314733-91afe.png 218w" sizes="(max-width: 218px) 100vw, 218px">\n    </span>\n  </span>\n  \n  </a>\n    \n\t </div>\n\t\n\t<div style="display: inline-block; padding:5px">\n    \n  <a class="gatsby-resp-image-link" href="/static/everland-8-983bb0d40596c9589364e72aeed5bf6d-8a305.png" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 251px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 128.28685258964143%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/jpeg;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="everland 8" title="" src="/static/everland-8-983bb0d40596c9589364e72aeed5bf6d-8a305.png" srcset="/static/everland-8-983bb0d40596c9589364e72aeed5bf6d-8a305.png 251w" sizes="(max-width: 251px) 100vw, 251px">\n    </span>\n  </span>\n  \n  </a>\n    \n\t  </div>\n</div>\n<figure class="align-center">\n    \n  <a class="gatsby-resp-image-link" href="/static/everland-10-0f81a9b97afece95b8ec59e8f0ccf1e5-d80e3.png" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 496px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 101.61290322580645%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/jpeg;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="everland 10" title="" src="/static/everland-10-0f81a9b97afece95b8ec59e8f0ccf1e5-d80e3.png" srcset="/static/everland-10-0f81a9b97afece95b8ec59e8f0ccf1e5-ff223.png 300w,\n/static/everland-10-0f81a9b97afece95b8ec59e8f0ccf1e5-d80e3.png 496w" sizes="(max-width: 496px) 100vw, 496px">\n    </span>\n  </span>\n  \n  </a>\n    \n  <figcaption></figcaption>\n</figure>\n<h3 id="span-stylecolorgreen-zootopia-span"><a href="#span-stylecolorgreen-zootopia-span" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a><span style="color:green"> Zootopia </span></h3>\n<div style="text-align: center">\n  <div style="display: inline-block; padding:10px">\n    \n  <a class="gatsby-resp-image-link" href="/static/everland-12-98f8848efdb55f9b60e9adbcb8d29b9b-376b2.png" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 449px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 65.70155902004454%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/jpeg;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="everland 12" title="" src="/static/everland-12-98f8848efdb55f9b60e9adbcb8d29b9b-376b2.png" srcset="/static/everland-12-98f8848efdb55f9b60e9adbcb8d29b9b-79bbb.png 300w,\n/static/everland-12-98f8848efdb55f9b60e9adbcb8d29b9b-376b2.png 449w" sizes="(max-width: 449px) 100vw, 449px">\n    </span>\n  </span>\n  \n  </a>\n    \n\t\t<div style="font-size: 20px" class="caption"> Seal </div>\n  </div>\n\t\n  <div style="display: inline-block; padding:10px">\n    \n  <a class="gatsby-resp-image-link" href="/static/everland-13-f38375cd06e8518aefa0691172533adc-376b2.png" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 449px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 75.50111358574611%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/jpeg;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="everland 13" title="" src="/static/everland-13-f38375cd06e8518aefa0691172533adc-376b2.png" srcset="/static/everland-13-f38375cd06e8518aefa0691172533adc-79bbb.png 300w,\n/static/everland-13-f38375cd06e8518aefa0691172533adc-376b2.png 449w" sizes="(max-width: 449px) 100vw, 449px">\n    </span>\n  </span>\n  \n  </a>\n    \n    <div style="font-size: 20px" class="caption"> Camel </div>\n  </div>\n\t\n\t<div style="display: inline-block; padding:10px">\n    \n  <a class="gatsby-resp-image-link" href="/static/everland-14-ea99ec9e5cac65f051d8d94f862071f4-6a7bd.png" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 450px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 86%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/jpeg;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="everland 14" title="" src="/static/everland-14-ea99ec9e5cac65f051d8d94f862071f4-6a7bd.png" srcset="/static/everland-14-ea99ec9e5cac65f051d8d94f862071f4-98671.png 300w,\n/static/everland-14-ea99ec9e5cac65f051d8d94f862071f4-6a7bd.png 450w" sizes="(max-width: 450px) 100vw, 450px">\n    </span>\n  </span>\n  \n  </a>\n    \n    <div style="font-size: 20px" class="caption"> Monkey </div>\n   </div>\n</div>\n<p>This is my most favorite zone in Everland theme park. ZooTopia is an animal-themed portion including a petting zoo, pony rides, and animal shows. You can see polar bears, sea lions, penguins, bears, tigers, and primates in a tiny zoo as well.</p>\n<p>\n  <a class="gatsby-resp-image-link" href="/static/everland-11-461b088ec4d6a34a5c037b8bdf38746a-6a7bd.png" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 450px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 64.66666666666666%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/jpeg;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="everland 11" title="" src="/static/everland-11-461b088ec4d6a34a5c037b8bdf38746a-6a7bd.png" srcset="/static/everland-11-461b088ec4d6a34a5c037b8bdf38746a-98671.png 300w,\n/static/everland-11-461b088ec4d6a34a5c037b8bdf38746a-6a7bd.png 450w" sizes="(max-width: 450px) 100vw, 450px">\n    </span>\n  </span>\n  \n  </a>\n     <strong>Safari Bus</strong>, <strong>Lost Valley</strong>, and <strong>Amazone Express</strong> are the most exciting attractions in this zone that you MUST NOT miss them.</p>\n<p>\n  <a class="gatsby-resp-image-link" href="/static/everland-15-123227fd39e798b021ba397d0c9dbd23-e6005.png" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 319px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 112.53918495297806%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/jpeg;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="everland 15" title="" src="/static/everland-15-123227fd39e798b021ba397d0c9dbd23-e6005.png" srcset="/static/everland-15-123227fd39e798b021ba397d0c9dbd23-2dc9f.png 300w,\n/static/everland-15-123227fd39e798b021ba397d0c9dbd23-e6005.png 319w" sizes="(max-width: 319px) 100vw, 319px">\n    </span>\n  </span>\n  \n  </a>\n     The Safari Bus ride shows animals such as ligers (a hybrid of lion and tiger) and bears in a contained habitat while the visitors stay inside the bus. Amazon Express is a raft ride, where most visitors get a cool splash of water along the 580-meter long water path. And for the Lost Valley that you will move from water to land, it has approximately 150 unique animal species roam freely.</p>\n<div style="text-align: center">\n  <div style="display: inline-block; padding:10px">\n    \n  <a class="gatsby-resp-image-link" href="/static/everland-16-02b622a36edc3b24aaf42deb3b7f0965-45a5d.png" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 173px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 68.20809248554913%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/jpeg;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="everland 16" title="" src="/static/everland-16-02b622a36edc3b24aaf42deb3b7f0965-45a5d.png" srcset="/static/everland-16-02b622a36edc3b24aaf42deb3b7f0965-45a5d.png 173w" sizes="(max-width: 173px) 100vw, 173px">\n    </span>\n  </span>\n  \n  </a>\n    \n    <div style="font-size: 20px" class="caption"> Giraffe </div>\n  </div>\n\t\n  <div style="display: inline-block; padding:10px">\n    \n  <a class="gatsby-resp-image-link" href="/static/everland-17-3eee69c81cfcfada5abc4939ba631494-45a5d.png" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 173px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 67.05202312138728%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/jpeg;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="everland 17" title="" src="/static/everland-17-3eee69c81cfcfada5abc4939ba631494-45a5d.png" srcset="/static/everland-17-3eee69c81cfcfada5abc4939ba631494-45a5d.png 173w" sizes="(max-width: 173px) 100vw, 173px">\n    </span>\n  </span>\n  \n  </a>\n    \n    <div style="font-size: 20px" class="caption">Liger</div>\n  </div>\n\t\n\t<div style="display: inline-block; padding:10px">\n    \n  <a class="gatsby-resp-image-link" href="/static/everland-18-b85411c19ac44ad53f8ffe6786cf342b-45a5d.png" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 173px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 67.05202312138728%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/jpeg;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="everland 18" title="" src="/static/everland-18-b85411c19ac44ad53f8ffe6786cf342b-45a5d.png" srcset="/static/everland-18-b85411c19ac44ad53f8ffe6786cf342b-45a5d.png 173w" sizes="(max-width: 173px) 100vw, 173px">\n    </span>\n  </span>\n  \n  </a>\n    \n    <div style="font-size: 20px" class="caption"> Lion </div>\n   </div>\n</div>\n<h3 id="admission-fees"><a href="#admission-fees" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Admission Fees</h3>\n<ul>\n<li>\n<p>One-day Ticket: Adults 54,000 won / Teenagers 46,000 won / Children &#x26; Seniors 43,000 won</p>\n</li>\n<li>\n<p>Night Ticket (after 17:00): Adults 45,000 won / Teenagers 39,000 won / Children &#x26; Seniors 36,000 won</p>\n</li>\n<li>\n<p>Two-day Ticket: Adults 84,000 won / Teenagers 71,000 won / Children &#x26; Seniors 67,000 won</p>\n</li>\n</ul>\n<p>But there are extra charges for coin-operated rides, rentals, animal rides, and special exhibitions. Donâ€™t forget to bring your passport, theyâ€™ll have discount for foreigner (as in my case).</p>\n<h3 id="span-stylecolorblue-how-to-get-there-span"><a href="#span-stylecolorblue-how-to-get-there-span" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a><span style="color:blue"> How to get there </span></h3>\n<p>You can get there by either subway or bus</p>\n<p>By <strong>subway</strong> Jeondae-Everland Station (Yongin EverLine), Exit 3. And then, take the shuttle bus to Everland (Operating hours 05:30-23:30).</p>\n<p>By <strong>bus</strong></p>\n<ul>\n<li>Sinnonhyeon, Gangnam, Yangjae Stations: Bus 5002</li>\n<li>Pangyo, Segok-dong, Suseo, Songpa, Jamsil, Gangbyeon Stations: Bus 5700</li>\n<li>Sadang, Nambu Terminal Stations (via Bundang and Gwangju): Bus 1500-2</li>\n<li>Gangbyeon, Gangdong Stations (via Gwangju): Bus 1113</li>\n</ul>\n<p><strong>SO</strong>, I highly recommend Everland theme park for one day guys. But you need to choose the games wisely and pick the right day or you\'ll beÂ wasting time considering and standing in line for your turn. I visited there in the Children\'s Day holiday in Korea so there was crowded and I wasted most of the time standing in line. That\'s the reason I had to skip some parts.Â Â And one thing, the perfect time to go there is Spring (March, Apr, May) and Autumn (Sep, Oct, early Nov), the weather is cool and not too shiny. Since you have to walk a lot, NEVER go in summer!</p>',
timeToRead:6,excerpt:"If you want to go to South Korea and find a place to entertain â€“ a bustling, funny and big enough for a whole day playing, why donâ€™t youâ€¦",frontmatter:{title:"Korea travel - Famous theme park Everland",cover:"/images/everland.png",date:"2014/03/31",category:"Travel",tags:["Travel","everland","theme-park","korea","ì—¬í–‰","du-lich","han-quoc","cong-vien-chu-de"]},fields:{slug:"/en/Korea-travel-Famous-theme-park-Everland/"}}},pathContext:{path:"/en/Korea-travel-Famous-theme-park-Everland/",langKey:"en"}}}});
